drop table if exists machines;
create table machines
(
    [id]            int unique primary key not null,
    [name]          text,
    [view_id]       int,
    [view_name]     text,
    [left]          int,
    [top]           int,
    [right]         int,
    [bottom]        int,
    [local_visible] int,
    [dfa_name]      text,
    [wip1_name]     text,
    [wip1_value]    int,
    [wip2_name]     text,
    [wip2_value]    int,
    [wip3_name]     text,
    [wip3_value]    int,
    [wip4_name]     text,
    [wip4_value]    int
);

